import styled from "styled-components";
import Button from "../components/buttons";

const Container = styled.div``;

function Nav() {
  <Container>
    <Button>Sports</Button>
    <Button>Roster</Button>
    <Button>Contact</Button>
  </Container>;
}

export default Nav;
